INSERT INTO `categories` VALUES (1,'nmwjiwzdt2ck2ljpkszumlzm','Arreglos Florales','2024-12-01 22:58:25.084000','2024-12-04 02:09:48.131000',NULL,1,1,NULL,'\"Arreglos Florales: El Regalo Perfecto para Cada Ocasión\"\n\nExplora nuestra selección de arreglos florales diseñados con amor y dedicación para expresar tus sentimientos en cualquier momento especial. Desde delicadas combinaciones románticas hasta vibrantes creaciones llenas de energía, nuestros arreglos destacan por su frescura, calidad y estilo único.\n\nYa sea para celebrar un cumpleaños, aniversario, logro, o simplemente para alegrar el día de alguien, aquí encontrarás opciones que se adaptan a cada ocasión y gusto. ¡Haz que cada detalle cuente con el lenguaje universal de las flores! 🌸','arreglos-florales'),(3,'ytfeix07ea7qevl830btvi6y','Accesorios tecnológicos','2024-12-01 23:06:50.420000','2024-12-04 02:09:42.923000',NULL,1,1,NULL,'Añade un toque adorable a tu mundo digital con nuestros accesorios tecnológicos kawaii. Diseños únicos, colores vibrantes y mucha ternura para acompañarte en tu día a día. ¡Tecnología con estilo y personalidad! 💖','accesorios-tecnologicos'),(5,'sr2lw5x2jkz8znfk2vhre35a','Peluches','2024-12-01 23:15:20.517000','2024-12-04 02:09:52.447000',NULL,1,1,NULL,'Muestrale tu amor a esa persona comprandole una peluche','peluches'),(7,'ytfeix07ea7qevl830btvi6y','Accesorios tecnológicos','2024-12-01 23:06:50.420000','2024-12-04 02:09:42.923000','2024-12-04 02:09:42.959000',1,1,NULL,'Añade un toque adorable a tu mundo digital con nuestros accesorios tecnológicos kawaii. Diseños únicos, colores vibrantes y mucha ternura para acompañarte en tu día a día. ¡Tecnología con estilo y personalidad! 💖','accesorios-tecnologicos'),(8,'nmwjiwzdt2ck2ljpkszumlzm','Arreglos Florales','2024-12-01 22:58:25.084000','2024-12-04 02:09:48.131000','2024-12-04 02:09:48.142000',1,1,NULL,'\"Arreglos Florales: El Regalo Perfecto para Cada Ocasión\"\n\nExplora nuestra selección de arreglos florales diseñados con amor y dedicación para expresar tus sentimientos en cualquier momento especial. Desde delicadas combinaciones románticas hasta vibrantes creaciones llenas de energía, nuestros arreglos destacan por su frescura, calidad y estilo único.\n\nYa sea para celebrar un cumpleaños, aniversario, logro, o simplemente para alegrar el día de alguien, aquí encontrarás opciones que se adaptan a cada ocasión y gusto. ¡Haz que cada detalle cuente con el lenguaje universal de las flores! 🌸','arreglos-florales'),(9,'sr2lw5x2jkz8znfk2vhre35a','Peluches','2024-12-01 23:15:20.517000','2024-12-04 02:09:52.447000','2024-12-04 02:09:52.465000',1,1,NULL,'Muestrale tu amor a esa persona comprandole una peluche','peluches'),(10,'l51it324rjlhwhvl9mlpe5k3','Joyería y accesorios','2024-12-04 02:20:57.142000','2024-12-04 02:20:57.142000',NULL,1,1,NULL,'Sorprende a tu pareja con lo que te afrecemos ','joyeria-y-accesorios'),(11,'l51it324rjlhwhvl9mlpe5k3','Joyería y accesorios','2024-12-04 02:20:57.142000','2024-12-04 02:20:57.142000','2024-12-04 02:20:57.153000',1,1,NULL,'Sorprende a tu pareja con lo que te afrecemos ','joyeria-y-accesorios'),(12,'gi4x02aoha9z4pa3flsqm4vi','Vinos y licores','2024-12-04 02:22:49.333000','2024-12-04 02:22:49.333000',NULL,1,1,NULL,'asdf','vinos-y-licores'),(13,'gi4x02aoha9z4pa3flsqm4vi','Vinos y licores','2024-12-04 02:22:49.333000','2024-12-04 02:22:49.333000','2024-12-04 02:22:49.344000',1,1,NULL,'asdf','vinos-y-licores'),(14,'sq3sgutprbx3ne8it9zuxc89','Viajes y escapadas','2024-12-04 02:23:43.413000','2024-12-04 02:23:43.413000',NULL,1,1,NULL,'Lugares romanticos','viajes-y-escapadas'),(15,'sq3sgutprbx3ne8it9zuxc89','Viajes y escapadas','2024-12-04 02:23:43.413000','2024-12-04 02:23:43.413000','2024-12-04 02:23:43.422000',1,1,NULL,'Lugares romanticos','viajes-y-escapadas');
